import { useContext } from "react";
import AuthApi from "./context/AuthApi";

const Home = () => {
    const Auth = useContext(AuthApi);
    const handleLogin = () => {
        Auth.setAuth(true);
    };
    return (
        <div>
            <h2>Home Page!</h2>
            <button onClick={handleLogin}>Login</button>
        </div>
    );
};
export default Home;
